import { useEffect, useState } from "react";
import Navbar from "../Navbar/navbar";
import Videopart from "../videopart/video";
import axios from "axios";
// import Navbar from "../Navbar/navbar";







function Home() {
    const [movies,setMovies]=useState()

    useEffect(()=>{
        async function getMovies(){
            await axios("http://127.0.0.1:8000/api/movies/")
            .then((response)=>{
                setMovies(response)
            },
            (error)=>{
                console.log(error);
            })
            .catch((error)=>{
                console.log(error)
            })
        }

        getMovies();
    },[movies])

    console.log(movies)

    return (
        <>
            <Navbar />
            <Videopart />
            <div className="row">

            </div>
        </>

    )


}



export default Home;
